import React from 'react';
import './ExtraImages.css';

const ExtraImages = () => {
  const images = [
    "/images/1-99-600x300.jpg",
    "/images/4d996c55fbb1beb91c43f4c24c.jpg",
    "/images/5cc6c54b6ffd0_B9YOMTg__700.webp",
  ];

  return (
    <div className="extra-images">
      {images.map((path, index) => (
        <div key={index} className="extra-image">
          <img src={path} alt={`Extra ${index + 1}`} style={{ maxWidth: '100%', height: 'auto' }} />
        </div>
      ))}
    </div>
  );
};

export default ExtraImages;
